import React from "react";
import "../../App.css";
import styled from "styled-components";

const Container = styled.div``;

const LoginButton = styled.button`
  background: #891c1a;
  border-radius: 23px;
  border: none;
  color: white;
  height: 45px;
  padding: 0 10px;
  margin: 0 10px;
  margin-top: 40px;
`;

const TextInput = styled.input`
  height: 40px;
  padding: 0 10px;
  width: "60%";
  margin: 10px;
  border-radius: 23px;
`;

const FormInput = styled.form`
  display:flex;
  flexDirection:"column";
  background: #000;
`;

export default function Login() {
  return (
    <FormInput>
      <TextInput></TextInput>
      <TextInput type="password"></TextInput>
      <LoginButton>I'm purple.</LoginButton>
    </FormInput>
  );
}
